  display: flex;
  justify-content: space-between;
  align-items: center;
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  z-index: 99;
  background: transparent;
  @media screen and (max-width: 968px) {
    font-size: 0;
    width: 50%;
    justify-content: flex-start;
  }
`

