    transition: 0.8s all ease;
    padding: 0 15px;
  }
  @media screen and (max-width: 400px) {
    padding: 5px 0 10px 25px;
    width: 150px;
  }
`

const NavBox = styled.div`
  display: flex;
  justify-content: center;
  right: 0;
  padding: 0 30px;
  gap: 12px;
  align-items: center;
  font-size: 16.4px;
  height: 22px;

  @media screen and (max-width: 968px) {
    display: none;
  }
